import React from 'react';
import './App.css';
import Produkty from './Produkty'; // Importujemy nasz komponent Produkty
import Platnosci from './Platnosci'; // Importujemy nasz komponent Platnosci

function App() {
  return (
    <div className="App">
      <h1>Moj sklep</h1>
      <Produkty/>
      <hr/>
      <Platnosci/>
    </div>
  );
}

export default App;
